全品！送料無料キャンペーン実施中！<br>(※一部地域除く詳しくはご利用ガイドをご覧ください)ナノテクリーンAC<br>
<br>
鉄金・塗装に<br>
自動車整備会社、ディーラーサービスにおける<br>
塗装作業。<br>
<br>
◆異物脱落を極力制御したクリーン用のためブツ不良を<br>
　軽減<br>
◆耐溶剤用ではないが、多少の耐溶剤に優れ、塗料など<br>
　シンナー系のものに最適<br>
◆選択して繰り返し使えるので経済的<br>
◆特殊ポリウレタンを全面コーティングしていますが<br>
　通気性があり、ムレにくい。<br>
<br>
サイズ：S・Ｍ・Ｌ・ＬＬ<br>
サイズをご指定下さい。<br>
カラー：ホワイト<br>
全長：30cm<br>
材質：ナイロン、ポリウレタン<br><img src="http://image.rakuten.co.jp/suncardo/cabinet/sign-banner/700x150-20.jpg" border="0">
